profile:
Design Studio Art Caprice is a team of professional designers, engineers and metal fabricators inspired by the numerous possibilities of laser cutting in the field of Interior and Exterior custom-designed metal works.

Alternative metal laser cut solutions continue to grow in popularity as architects, builders and homeowners look for creative ways to personalize and differentiate spaces.

We serve homeowners, interior designers, builders, architects, retail stores and offer them high-quality custom-designed metal laser cut products.

· We are developing a global brand by investing our creativity, passion, and a whole lot of hard work.

· Each piece is custom made at our facility using the latest laser-cutting technology to order and can be customized to suit your individual needs including bending, welding works, and a variety of powder-coat colors.

· Unique and unlike any other custom modern outdoor or interior laser cut products in the industry.

· More than six hundred designs can be found in our portfolio for a variety of tastes, desired uses, potential locations, and settings.

· You can find the image/design you like best by discovering every page of our website. We will apply this image/design to the products you need for your home or business.

· You can send us your own drawing, ALL DESIGN WORK is FREE for our valued customers.

PRODUCTS:

· Metal Garden Gates;

· Fence Screens & Panels;

· Lawn Address Sign Panels and Address Plagues;

· Metal Balusters, Ornamental Metal Pickets, Railing Decorative Panel Inserts, Staircase Railing Panels;

· Deck Railing Panels & Decorative Deck Panel Inserts;

· Outdoor Privacy Screens & Pergola Roof Screens;

· Indoor Decorative Screens & Partitions;

· Door Inserts & Security Screens;

· Outdoor & Indoor Light Boxes;

· Ceiling Panels;

· Fireplace Screens & Log Holders;

· Metal Headboards;

· Personalized Monogram, Family Name Signs & Family Crests.

· Metal Wall Art.

SERVICES:

Design Studio Art Caprice Corp. manufactures and supplies your orders only and does not provide installation services. Prior to manufacturing we require your measurements to be forwarded to us as well as your postal/zip code if your require shipping service.

PAYMENT METHOD:

A 100% deposit is required for all orders, prior to commencing work. Payments can be made via credit card, debit card or direct bank transfer. All custom made products are final sale.

MANUFACTURING TIME:

All items are made after an order is placed and are ready to be dispatched/shipped within 2-3 weeks of payment. We would be happy to rush your order free of charge, just let us know when placing your order and we will do everything we can to make it happen
